When the iframe is loaded, it will send a message to the parent window. The message is a json string. The json object has the following properties: { "repl": { "id": "", "dimensions": { "width": 800, "height": 600 }, "editor": { "readonly": false, "theme": "light", "language": "python", "code": "# This is a default python code

print('Hello world')", "defaultCode": "# This is a default python code

print('Hello world')" }, "output": { "data": [], "status": "loading" } }
} What you should do fist is to send some basic information to the iframe including id and editor data. The id is used to identify the editor if you have more that one iframes in you page. The id is empty at first. When new information updated, id will be sent with it. The editor information is used to initialize the editor. The dimensions is used to set the width and height of the iframe. The output data is used to display the output of the code. The status can be idle , loading , running or finished . The data is an array of objects. Each object has a color and msg . The color is used to set the color of the message which can be normal or red . The msg is used to display the message.

