<iframe src="http://localhost:4173/" width="100%" allow="clipboard-write"></iframe>
<script> const id = "ac2f5a2"; const lang = "python"; const theme = "light"; const readonly = false; const code = "# Python\n\nprint('Hello world')"; const iframe = document.querySelector("iframe"); const postmessage = (msg) => iframe.contentWindow.postMessage({ repl: msg }, "*"); window.addEventListener("message", (event) => { const replData = event.data.repl; if (event.source === window || !replData) return; // if the id is empty, then it's the first time the iframe is loaded if (replData.id === "") { postmessage({ id, editor: { theme, lang, code, readonly, defaultCode: code } }); return; } if (replData.id !== id) return; // update the iframe height iframe.style.height = replData.dimensions.height + "px"; });
</script> ðŸ’¥ Attention You need to add allow="clipboard-write" to the iframe to make the clipboard work.

